import React from 'react'
import Bg2 from '../image/3.png';

function Testimonial() {
    return (
        <div className='bg-top-right p-10 bg-black' style={{ backgroundImage: `url(${Bg2})` }}>
            <h3 className=''>100+ HAPPY CLIENTS</h3>
            <h1 class="testi">TESTIMONIALS</h1>
            <p class="ep">"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat Duis aute irure dolor in reprehenderit in voluptate"</p>
            <p><strong>John Doe, CEO Microsoft</strong></p>
            <p>July 27, 2018</p>
            <div className='flex flex-col'>
                <div><svg xmlns="http://www.w3.org/2000/svg" height="18px" viewBox="0 0 24 24" width="18px" fill="#d9a520"><path d="M24 24H0V0h24v24z" fill="none" /><circle cx="12" cy="12" r="8" /></svg>
                </div>
                <svg xmlns="http://www.w3.org/2000/svg" height="18px" viewBox="0 0 24 24" width="18px" fill="#d9a520"><path d="M0 0h24v24H0V0z" fill="none" /><path d="M12 6c3.31 0 6 2.69 6 6s-2.69 6-6 6-6-2.69-6-6 2.69-6 6-6m0-2c-4.42 0-8 3.58-8 8s3.58 8 8 8 8-3.58 8-8-3.58-8-8-8z" /></svg>
                <svg xmlns="http://www.w3.org/2000/svg" height="18px" viewBox="0 0 24 24" width="18px" fill="#d9a520"><path d="M0 0h24v24H0V0z" fill="none" /><path d="M12 6c3.31 0 6 2.69 6 6s-2.69 6-6 6-6-2.69-6-6 2.69-6 6-6m0-2c-4.42 0-8 3.58-8 8s3.58 8 8 8 8-3.58 8-8-3.58-8-8-8z" /></svg>
            </div>
        </div>
    );
}

export default Testimonial
